import { sha256 } from 'js-sha256';
// import * as $ from 'jquery';

function Hash() {
    let text = `
        THIS IS DESCRIPTIVE TEXT
    `;

    return (
        <div>
        'text=' + {text}
        'hash=' + {sha256(text)}
        </div>
    );
}

export default Hash;
